"use strict";Vue.component("count-down",{template:'\n    <div class="timer">\n    <div class="time-icon"><i class="fas fa-caret-right"></i></div>\n    <div class="time">\n        <div class="time-val">{{days}}</div>\n        <div class="time-title">days</div>\n    </div>\n    <div class="time">\n        <div class="time-val">{{hours}}</div>\n        <div class="time-title">hours</div>\n    </div>\n    <div class="time">\n        <div class="time-val">{{minutes}}</div>\n        <div class="time-title">minutes</div>\n    </div>\n    <div class="time">\n        <div class="time-val">{{seconds}}</div>\n        <div class="time-title">seconds</div>\n    </div>\n    <div class="time-icon"><i class="fas fa-caret-left"></i></div>\n</div> \n    ',data:function(){return{days:"",hours:"",minutes:"",seconds:""}},methods:{countDown:function(){this.calcTime();setInterval(function(){this.calcTime()}.bind(this),1e3)},calcTime:function(){var i=new Date("March 31, 2019 23:59:59").getTime()-(new Date).getTime(),s=Math.floor(i/864e5),e=Math.floor(i%864e5/36e5),t=Math.floor(i%36e5/6e4),n=Math.floor(i%6e4/1e3);function a(i){return i<10&&(i="0"+i),i}this.days=a(s),this.hours=a(e),this.minutes=a(t),this.seconds=a(n)}},mounted:function(){this.countDown()}});var app=new Vue({el:"#app"});function navbar(){var i=document.getElementById("navbarToggle"),s=document.getElementsByClassName("navbar-nav");i.onclick=function(){s[0].classList?s[0].classList.toggle("hide"):0<=s[0].className.split(" ").indexOf("hide")?s[0].className=s[0].className.replace(/\bhide\b/g,""):s[0].className+=" hide"}}navbar();